const Footer = () => {
    return(
        <footer className="footer mt-auto py-3 bg-dark">
            <div className="container">
                <p className="text-ligth">App desenvolvido por <a href="https://github.com/Brutos212" target="_blank" rel="noreferrer">Fabio Santos</a></p>
                <p className="text-ligth"><small><strong>Semana Estudo Spring com React</strong><br/>
                Evento promovido pela escola DevSuperiror: <a href="https://instagram.com/devsuperior.ig" target="_blank" rel="noreferrar">@devsuperior.ig</a></small></p>
            </div>

        </footer>

    )

}

export default Footer;
